import './index.css';
import {marked} from 'marked';
import { useState } from "react";


function App() {
  const [markdown, setMarkdown] = useState(``);
  function change(e){
    setMarkdown(e.target.value);
  }
  return (
    <html>
      <div className="app border-solid border-2 ">
        <textarea className="bg-red" onChange={change} value={markdown}/>
      </div>

        <div
          className="preview  border-solid border-2 "
          dangerouslySetInnerHTML={{__html: marked(markdown)}}/>
    </html>
  );
}
